import React, {StrictMode } from "react";
import {createRoot} from "react-dom/client";
import Header from "./message";
import Main from "./heard";
import Aside from "./heard";


const root = createRoot(document.getElementById("root"));
root.render(
    <StrictMode>
           <Header></Header>
           <Main></Main>
           <Aside></Aside>
           <Footer></Footer>
    </StrictMode>

);
